import React from 'react';

const UserSignup = () => {
    return (
        <div>
            <div className='signupCont'>
                <div>
                <h2>Register</h2>
                <h3>User Name</h3>
                <div>
                    <input type='text'/>
                </div>
                </div>
                
            </div>
        </div>
    );
}

export default UserSignup;
